import React from "react";
import "./Chatting.css";
// import NavTop from "./NavTop/NavTop";
import NavTop2 from "./NavTop/NavTop2";
import human from "../../../Image/human.jpg"
// import List from "./List/List";

const Chatting = () => {
  return (
    <div className="chatting">
      <div className="container">
        <div className="row">
          <div className="col">
            <div className="row">
              <div className="col-lg-4 one">
              <img src={human} alt="" width="60" className="rounded-circle" />
          <i className="fa fa-bars icon float-right"></i>
                {/* <NavTop /> */}
              </div>
              <div className="col-lg two">
                <NavTop2 />
              </div>
            </div>
            <div className="row">
              <div className="col-lg-4 three">
                  {/* <List/> */}
                {/* <NavTop /> */}
              </div>
              <div className="col-lg four">
                {/* <NavTop2 /> */}
              </div>
            </div>
            <div className="row">
              <div className="col-lg-4 five">
                {/* <NavTop /> */}
              </div>
              <div className="col-lg six">
                {/* <NavTop2 /> */}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Chatting;
